PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>

SELECT ?timezone WHERE {
  res:Salt_Lake_City dbo:timeZone ?timezone .
}

SELECT ?president ?name WHERE {
  ?president dbo:office <http://dbpedia.org/resource/President_of_the_United_States> ;
             dbo:termStart ?termStart ;
             dbo:termEnd ?termEnd ;
             foaf:name ?name .
  FILTER ( 
      (?termStart <= "1975-04-30"^^xsd:date && ?termEnd >= "1955-11-01"^^xsd:date)
  )
} ORDER BY ?termStart

SELECT ?state WHERE {
  ?person dbo:birthName "Butch Otter" .
  ?person dbo:office ?office .
  ?office dbo:location ?state .
  FILTER (langMatches(lang(?state), "EN"))
}

SELECT (COUNT(?medal) AS ?goldMedalCount)
WHERE {
  ?medal dbo:wikiPageRedirects dbr:Gold_medal.
  ?event dbp:goldmedalist dbr:Michael_Phelps.
  ?event dbo:olympicGames dbr:2008_Summer_Olympics.
}

SELECT DISTINCT ?person ?name WHERE {
  dbpedia:Rachel_Stevens dbo:birthDate ?birthdate .
  ?person dbo:birthDate ?birthdate .
  ?person foaf:name ?name .
  FILTER (?person != dbpedia:Rachel_Stevens)
}

