SELECT ?airline ?frequentFlyerProgram WHERE {
        ?airline a dbo:Airline;
            dbo:frequentFlyer ?:frequentFlyerProgram.
} LIMIT 500

SELECT ?country (count(?cave) as ?num_of_caves) WHERE {
  ?cave dct:subject dbc:Caves_by_country ;
        dbo:location ?country .
  ?country a dbo:Country
} 
GROUP BY ?country
HAVING (?num_of_caves > 2)

