           rdfs:label ?nombre ;
           dbo:birthDate ?fechaNacimiento ;
           dbo:deathDate ?fechaMuerte .
  FILTER ((?fechaNacimiento >= "1920-01-01"^^xsd:date && ?fechaNacimiento <= "1933-12-31"^^xsd:date) || 
          (?fechaMuerte >= "1920-01-01"^^xsd:date && ?fechaMuerte <= "1933-12-31"^^xsd:date))
  FILTER (LANG(?nombre) = "en")         
}
LIMIT 100

